```

Rotate (anti-clockwise) a [`Vector2`] by an angle.
# Examples
```
use cute_gorl::vector2::*;
use std::f64::consts::PI;
let mut v = Vector2 { x: 1., y: 1. };
assert_eq!(
    v.rotate(0.5*PI),
    Vector2 { x: -1., y: 1. }
);
```

Reflect a [`Vector2`] off of a surface with a certain normal [`Vector2`].
# Examples
```
use cute_gorl::vector2::*;
