The crossproduct of two [`Vector3`]s.
# Examples
```
use cute_gorl::vector3::*;
let v1 = Vector3 { x: 1., y: 2., z: 3. };
let v2 = Vector3 { x: 4., y: -5., z: 0. };
assert!(!Vector3::is_coplanar(
    &v1,
